import axios from 'axios';
import { useEffect } from 'react/cjs/react.production.min';

import './App.css';

function App() {
  try {
    axios.get(`https://api.openweathermap.org/data/2.5/weather?lat=35&lon=139&appid=${process.env.REACT_APP_OPENWEATHER_KEY}`).then(res => console.log(res));
  } catch(error) {
    console.log(error);
  }

  return (
    <div className="App">
      <header className="App-header">
       hello  
      </header>
    </div>
  );
}

export default App;
